        { id: 1, date: '2024-10-07', title: 'Event 1' },
        { id: 2, date: '2024-10-09', title: 'Event 2' },
        { id: 3, date: '2024-10-10', title: 'Event 3' },
    ];

    return (
        <div>
            <h1>Events Page</h1>
            <Calendar events={events} /> {/* Ensure this line passes the events correctly */}
        </div>
    );
};

export default Events;
